import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Check if cart is empty and add an item if needed
    const cartCount = await page.$eval('.cart', el => parseInt(el.textContent.trim()));

    if (cartCount === 0) {
      // Add an item to cart first
      await page.click('.product-card:first-child .add-to-cart');
      await page.waitForTimeout(1000); // Wait for cart to update
    }

    // Open cart modal
    await page.click('.cart');
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_with_items.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_with_items.png'));

    // Remove first item from cart
    await page.click('.remove-item:first-child');
    await page.waitForSelector('.empty-cart', { timeout: 5000 });

    // Take screenshot of empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Verify cart is empty
    const emptyCartText = await page.$eval('.empty-cart', el => el.textContent.trim());
    const finalCartCount = await page.$eval('.cart', el => parseInt(el.textContent.trim()));

    return {
      success: true,
      action: "Removed item from cart successfully",
      extractedData: {
        initialCartCount: cartCount,
        finalCartCount: finalCartCount,
        emptyCartMessage: emptyCartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
